comment_text:
@TheDiaryOfACEO Less hamster wheel and more robo vac please. Both in constant motion and productivity, but let’s go back over what we’ve already learned some and leave the exhaustive endless running that we can’t do anything with because we’re already on to the next. 
I appreciate the diverse thoughts and opinions you bring to your table. BUT it’s too much now. We would love it if you could do a panel discussion so we can hear the back and forth nuances of what all the experts claim. How can they be so opposite and both have studies to back it up. Let’s talk about it! 
I’m not listening to every episode like I used to because my brain is tired of trying to decipher what I’m going to believe, or to go do more research on my own. I want to always be learning, but I only have the capacity for so much at a time. And such differing viewpoints are exhausting. Don’t stop with the diverse thoughts, but please stop adding more confusion and let’s go deeper and dissect what we’ve already been learning.

