I listened because I like to hear all sides, I'm hearing; 
the food industry really wants to make healthy foods... The food industry wants to make a profit.; 
Seed oils are good for us... Humans have evolved beautifully without ultra-processed anything.;
Cholesterol is bad... We require cholesterol for many processes, hormones, etc in the human body, and blood samples taken from centenarians show high LDL levels.; 
Animal products, meat is bad... this is where she completely lost me, evolution again, ketosis to fight cancer, ketosis to reverse diabetes, ketosis to fight dementia (the brain works most efficiently on ketone as fuel).  

As a species in the west we have been getting further and further away from ketosis.. how has that been working out for us?  Take a look at rates of heart disease, cancer, etc. and we see the answer.  

There is something disingenuous in the vibe of this podcast. 
I call nutrib*ll*cks.

I'd love to see a genuine long-form podcast between opposing sides of the argument, with links to the studies (and who funded them) included in the notes.

@matthewthehawk1066  I'm okay with you having no idea because I don't have time for back and forth in youtube comments. The "saturated fat is bad" ideology is a fallacy and is traceable should you ever wish to look into it. Much corruption was involved and included fraudulent "research"  since debunked. It is the combination of fat with processed carbohydrates that is the issue, coupled with minimal exercise.

My issue was her simultaneously minimising the destructive effect of seed oils and sugar. I've seen the worst oil (canola/rapeseed oil) put into everything when it should have maintained it's original purpose as engine lubricant.

It's a similar fallacy with salt, table salt is the problem within processed fake foods.

